import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import '../styles/footer.css';

const Footer = () => {
  return (  
    <div className="footer-container">
      <footer>
        <ul>
            <li>
                <a href="https://github.com/zoyasarow" class="link-info"><FontAwesomeIcon icon="fa-brands fa-github" /></a>
                <a href="https://www.linkedin.com/in/zoya-sarow-96547b115/?locale=ar_AE" class="link-info"><FontAwesomeIcon icon="fa-brands fa-linkedin" /></a>
                <a href="mailto:zoyasarow@gmail.com" class="link-info"><FontAwesomeIcon icon="fa-solid fa-square-envelope" /></a>
            </li>
        </ul>
      </footer>
    </div>   
  );
};

export default Footer;
